import React, { Component } from 'react'
import SearchBar from './SearchBar'
import NavComponent from './NavComponent'

export default class SearchHome extends Component {
    constructor(props) {
        super(props)

        this.state = {
             currentDot: "us"
        }
    }

    render() {

        const usOptions = ["us", "the world","the environement", "the oceans", "the forests", "ourselves"]

        function changeDot(current) {
            setInterval(()=> {
                const random = Math.floor(Math.random() * usOptions.length)
                return usOptions[random]
            }, 4000)
        }

        return (
            <>
                <div className="psuedo-nav">
                    <NavComponent />       
                </div>


                <div className="search-box-center"> 
                    <div>
                        <div className="titles"> 
                            <p id="title-home">
                                Sustain.{changeDot}}
                            </p>
                            <p id="sub-title">
                                Connecting with you sustainable businesses
                            </p>
                        </div>
                        <SearchBar />
                    </div>
                </div>

                <div className="footer">

                </div>
            </>
        )
    }
}
